import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <div>
            <nav className="navbar">
                <h1>Hesper's Chaos and Calm</h1>
                <div className="links">
                    <a href="/">Heart</a>
                    <a href="/create">Create Chaos</a>
                </div>
            </nav>
        </div>
    )
}

export default Navbar
